          <img className="w-full h-full object-cover" src={tempImg} />
        </div>
        <div className="w-auto h-10">
          <img className="w-full h-full object-cover" src={tempImg} />
        </div>
        {/* {props.logo.map((l) => {
          return (
            <div className="w-auto h-10">
              <SVG className="w-full h-full" src={l} />
            </div>
          );
        })} */}
      </div>
    </div>
  );
};

export default tabContent;
